import React, { useState, useEffect } from "react";
import axios from 'axios';
import { Card, CardBody, CardHeader, Table, Row, Col, Button, Input, FormGroup } from "reactstrap";
import PanelHeader from "components/PanelHeader/PanelHeader.js"; // Importación de un componente personalizado

const API_CARRITO_URL = 'https://localhost:7194/api/CarritoCompras';

const obtenerCarrito = async (carritoId) => {
  try {
    const response = await axios.get(`${API_CARRITO_URL}/${carritoId}`);
    return response.data;
  } catch (error) {
    console.error('Error al obtener carrito:', error);
    throw error;
  }
};

function VistaCarrito({ carritoId }) {
  const [carrito, setCarrito] = useState(null);
  const [cupon, setCupon] = useState("");
  const [total, setTotal] = useState(0);

  useEffect(() => {
    const fetchCarrito = async () => {
      try {
        const data = await obtenerCarrito(carritoId);
        setCarrito(data);
        calcularTotal(data);
      } catch (error) {
        console.error("Error al obtener el carrito:", error);
      }
    };

    fetchCarrito();
  }, [carritoId]);

  const calcularTotal = (data) => {
    let total = data.items.reduce((sum, item) => sum + item.precio * item.cantidad, 0);
    setTotal(total);
  };

  const aplicarCupon = () => {
    // Lógica para aplicar el cupón y actualizar el total (ejemplo)
    // Esto es solo un ejemplo. La lógica real depende de cómo manejes los cupones.
    let descuento = 0;
    if (cupon === "DESCUENTO10") descuento = 0.1;
    setTotal(total * (1 - descuento));
  };

  return (
    <>
      <PanelHeader size="sm" />
      <div className="content">
        <Row>
          <Col xs={12}>
            <Card>
              <CardHeader>
                <h4 className="title">Carrito de Compras</h4>
              </CardHeader>
              <CardBody>
                {carrito ? (
                  <>
                    <Table responsive>
                      <thead className="text-primary">
                        <tr>
                          <th>Producto</th>
                          <th>Precio</th>
                          <th>Cantidad</th>
                          <th>Total</th>
                        </tr>
                      </thead>
                      <tbody>
                        {carrito.items.map((item, index) => (
                          <tr key={index}>
                            <td>{item.nombre}</td>
                            <td>{item.precio}</td>
                            <td>{item.cantidad}</td>
                            <td>{item.precio * item.cantidad}</td>
                          </tr>
                        ))}
                      </tbody>
                    </Table>
                    <div className="d-flex justify-content-between">
                      <h4 className="title">Total: ${total.toFixed(2)}</h4>
                      <FormGroup>
                        <Input 
                          type="text" 
                          placeholder="Ingrese código de cupón" 
                          value={cupon}
                          onChange={(e) => setCupon(e.target.value)}
                        />
                        <Button color="primary" onClick={aplicarCupon}>Aplicar Cupón</Button>
                      </FormGroup>
                    </div>
                  </>
                ) : (
                  <p>Cargando carrito...</p>
                )}
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
    </>
  );
}

export default VistaCarrito;
